const formatDate = (date, format) => {
  date = date.replace(' ', 'T');
  const d = new Date(date);
  let month = '' + (d.getMonth() + 1);
  let day = '' + d.getDate();
  const year = d.getFullYear();

  if (month.length < 2) {
    month = '0' + month;
  }

  if (day.length < 2) {
    day = '0' + day;
  }

  switch (format) {
    case 'dd/MM/yyyy':
      return [day, month, year].join('/');

    case 'MM/dd/yyyy':
      return [month, day, year].join('/');

    case 'yyyy/MM/dd':
    default:
      return [year, month, day].join('/');
  }
};
